import React from "react"
import aboutFoto from "../../assets/People.jpg"
import Separator from "../../assets/Decoration.svg";
import signature from "../../assets/Signature.svg";

export default function HomeAbout() {
    return (
        <section className="aboutUs" >
            <div className="aboutUs-aboutText about-column">
                <h2 className="aboutText-title">O nas</h2>
                <img src={Separator} alt="separator" className="separator"/>
                <p className="aboutText-description">Nori grape silver beet broccoli kombu beet greens fava bean potato
                    quandong celery. Bunya nuts black-eyed pea prairie turnip leek lentil turnip greens parsnip.</p>
                <img src={signature} alt="signature" className="aboutText-signature"/>
            </div>
            <div className="aboutUs-aboutImage about-column" style={{ backgroundImage: `url(${aboutFoto})` }}>

            </div>
        </section>
    )
}
